CREATE FUNCTION srv_validacao(_srv_edicao character varying, _srv_revisao character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
                BEGIN
                    RETURN 
                        CASE 
                            WHEN CAST(_srv_edicao as integer) >= 0 THEN _srv_edicao
                            ELSE _srv_revisao
                        END;
                END;
            $$;


