CREATE FUNCTION valor_validacao(_valor character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $$
                BEGIN
                    RETURN 
                        CASE 
                            WHEN CAST(_valor as integer) >= 0 THEN CAST(_valor AS INTEGER)
                            ELSE 0
                        END;
                END;
            $$;


